import React, { useState } from 'react';
import { makeStyles, useTheme } from '@mui/styles';
import Grid from '@mui/material/Grid';
import Typography from '@mui/material/Typography';
import RecentSearchV1 from '../components/RecentSearchV1';
import SearchBarV1 from '../components/SearchBarV1';
import AppButton from '../components/AppButton';

const useStyles = makeStyles(theme => ({
    mr1: {
        marginRight: '1rem !important'
    },
    mt1: {
        marginTop: '1rem !important'
    },
    px2: {
        paddingLeft: '2rem !important',
        paddingRight: '2rem !important'
    }
}));

function SearchPage( { isOldVersion, isSearching, startSearch, cancelSearch, doSearch } ) {
    const theme = useTheme();
    const classes = useStyles();

    const recentSearchList = JSON.parse(window.localStorage.getItem('recentSearchList')); 

    return (
        <Grid container alignItems="flex-start" justifyContent="flex-start">
            {isOldVersion && (
                <SearchBarV1 
                    isSearching={isSearching} 
                    startSearch={startSearch} 
                    cancelSearch={cancelSearch}
                    doSearch={doSearch}
                />
            )}
            {isOldVersion && isSearching && (
                <Grid item className={classes.mt1}>
                    <AppButton content="Sports" className={`${classes.px2} ${classes.mr1}`} />
                    <AppButton content="Venue" className={`${classes.px2} ${classes.mr1}`} />
                </Grid>
            )}
            {isSearching && recentSearchList && recentSearchList.length > 0 && (
                <Grid item className={classes.mt1}>
                    <RecentSearchV1 content="Sports" className={`${classes.px2} ${classes.mr1}`} />
                    <AppButton content="Venue" className={`${classes.px2} ${classes.mr1}`} />
                </Grid>
            )}
        </Grid>
    );
}

export default SearchPage;
